// インタラクティビティの追加を学ぶ

// イベントハンドラにおいてpropsの読み取りを実施したいと思います。

function Button({onSmash,children}){
  return(
    <button onClick={e => {
      e.stopPropagation();
      onSmash();
    }}>
      {children}
    </button>
  );
}

function Toolbar({on削除,on保存}){
  return(
    <>
      <Button onSmash={on削除}>削除</Button>
      <Button onSmash={on保存}>保存</Button>
    </>
  );
}

export default function App(){
  return (
  <div className="background-red" onClick={()=> alert("タッチを認識しました。")}>
    <Toolbar on削除={()=>alert('削除されました')} on保存={()=>alert('保存されました')}/>
  </div>
  );
}
